    "2013-03-14T19:30:46.632997",nt"name": "red-sesbania-distribution-points-ds80",nt"isopen":
    false,nt"url": null,nt"notes": "This layer contains point data for the
    red sesbania (Sesbania punicea) database. The database represents historic and current
    observations by various individuals of occurrences red sesbania, a non-native invasive
    plant that currently is invading riparian ecosystems in California. Most occurrences
    are in the Central Valley, but a few are in the San Francisco Bay area and in a
    few watersheds to the north. These data were compiled to aid in the eradication
    and control of the species where it is invasive, as well as to inform the public
    of its spread. As of February 1, 2006, there were 91 records of point occurrences
    maintained in an Access database titled SesbaniaData. Each record represents a point
    where red sesbania occurs.",nt"license_title": null,nt"extras": [{ntt"key":
